INSERT INTO `v1_5985dde530e551c2c3a91c065240101b86bd778aeb393f586a587e39f8612fc8` VALUES (24015, 10021, 4, "2030/12/17 14:59:59", 0.0, 0.0, 24, 1, "2019/07/31 12:00:00", 110501, 0.0, 4, "カオリ（サマー）", "あうぅ～残念さ～\nマジムンに魂を\n奪われちゃったかな～？");
INSERT INTO `v1_5985dde530e551c2c3a91c065240101b86bd778aeb393f586a587e39f8612fc8` VALUES (24016, 10021, 4, "2030/12/17 14:59:59", 0.0, 0.0, 24, 2, "2019/07/31 12:00:00", 110501, 4.0, 1, "カオリ（サマー）", "今日は踊りのキレも悪いよ～\nゴーヤーっぽいもの食べて、元気回復さ～！");
INSERT INTO `v1_5985dde530e551c2c3a91c065240101b86bd778aeb393f586a587e39f8612fc8` VALUES (24017, 10021, 4, "2030/12/17 14:59:59", 0.0, 0.0, 24, 3, "2019/07/31 12:00:00", 110501, 0.0, 4, "カオリ（サマー）", "マジムンだらけで目が回るさ～！\nふらふらさ～！");
INSERT INTO `v1_5985dde530e551c2c3a91c065240101b86bd778aeb393f586a587e39f8612fc8` VALUES (24018, 10021, 1, "2030/12/17 14:59:59", 0.0, 0.0, 24, 4, "2019/07/31 12:00:00", 110501, 5.2, 2, "カオリ（サマー）", "なんくるない、なんくるない\n次、頑張ればいいんだよ～！\n海で泳いで\nリフレッシュするさー！");
INSERT INTO `v1_5985dde530e551c2c3a91c065240101b86bd778aeb393f586a587e39f8612fc8` VALUES (24019, 10021, 5, "2030/12/17 14:59:59", 0.0, 0.0, 24, 5, "2019/07/31 12:00:00", 110501, 4.2, 6, "カオリ（サマー）", "恥ずかしいところ\n見られちゃったね～\n水着？　水着のことじゃないよー？");
INSERT INTO `v1_5985dde530e551c2c3a91c065240101b86bd778aeb393f586a587e39f8612fc8` VALUES (24020, 10021, 2, "2030/12/17 14:59:59", 0.0, 0.0, 24, 6, "2019/07/31 12:00:00", 110501, 0.0, 2, "カオリ（サマー）", "絶好調さ～！　この調子で\n海の平和を取り戻すよ～！\n楽しい夏が待ってるさ～！");
INSERT INTO `v1_5985dde530e551c2c3a91c065240101b86bd778aeb393f586a587e39f8612fc8` VALUES (24021, 10021, 1, "2030/12/17 14:59:59", 0.0, 0.0, 24, 7, "2019/07/31 12:00:00", 110501, 6.4, 6, "カオリ（サマー）", "何匹で襲ってきたって\n私はマブイを落っことさないよ～！\nくしゅん！　あ……\n今のくしゃみで落っこちたかも～？");
INSERT INTO `v1_5985dde530e551c2c3a91c065240101b86bd778aeb393f586a587e39f8612fc8` VALUES (24022, 10021, 2, "2030/12/17 14:59:59", 0.0, 0.0, 24, 8, "2019/07/31 12:00:00", 110501, 0.0, 2, "カオリ（サマー）", "ひーやーさーさー♪\n戦いの後は、踊りを踊って\n気分スッキリさ～！");
INSERT INTO `v1_5985dde530e551c2c3a91c065240101b86bd778aeb393f586a587e39f8612fc8` VALUES (24023, 10021, 6, "2030/12/17 14:59:59", 0.0, 0.0, 24, 9, "2019/07/31 12:00:00", 110501, 10.08, 3, "カオリ（サマー）", "あれ～？　戦ってるうちに\n水着がどっか行っちゃった～？\nねぇキミ、どっかで見なかった～？\nなんで離れるさ～？");
INSERT INTO `v1_5985dde530e551c2c3a91c065240101b86bd778aeb393f586a587e39f8612fc8` VALUES (24024, 10021, 1, "2030/12/17 14:59:59", 0.0, 0.0, 24, 10, "2019/07/31 12:00:00", 110501, 5.0, 2, "カオリ（サマー）", "まだまだ私は元気だよ～！\nマジムンでもなんでも、\nどんとこーいさー♪");
INSERT INTO `v1_5985dde530e551c2c3a91c065240101b86bd778aeb393f586a587e39f8612fc8` VALUES (24025, 10021, 2, "2030/12/17 14:59:59", 0.0, 0.0, 24, 11, "2019/07/31 12:00:00", 110501, 0.0, 2, "カオリ（サマー）", "私の空手は世界最強さ～！\n夏の陽射しと青い海も合わされば、\n向かうところ敵なしだよー！");
